import React, { useEffect, useRef } from "react";
import Chart from "react-apexcharts";
import jQuery from 'jquery'; 

declare global {
  interface Window {
    Apex: any;
    ApexCharts: any;
  }
  interface JQuery {
    vectorMap(options?: any): void;
  }
}


interface DashboardProps {}
const TotalRevenueChart = () => {
  const worldMapMarkersRef = useRef<HTMLDivElement | null>(null);

  useEffect(() => {
    initMaps();
  }, []);


  const initMaps = () => {
    if (worldMapMarkersRef.current) {
      jQuery(worldMapMarkersRef.current).vectorMap({
        map: "world_mill_en",
        normalizeFunction: "polynomial",
        hoverOpacity: 0.7,
        hoverColor: false,
        regionStyle: { initial: { fill: "#e3eaef" } },
        markerStyle: {
          initial: {
            r: 9,
            fill: "#727cf5",
            "fill-opacity": 0.9,
            stroke: "#fff",
            "stroke-width": 7,
            "stroke-opacity": 0.4,
          },
          hover: { stroke: "#fff", "fill-opacity": 1, "stroke-width": 1.5 },
        },
        backgroundColor: "transparent",
        markers: [
          { latLng: [40.71, -74], name: "New York" },
          { latLng: [37.77, -122.41], name: "San Francisco" },
          { latLng: [-33.86, 151.2], name: "Sydney" },
          { latLng: [1.3, 103.8], name: "Singapore" },
        ],
        zoomOnScroll: false,
      });
    }
  };

  return (
    <div className="col-xl-4">
      <div className="card-box">
        <div className="dropdown float-right">
          <a
            href="#"
            className="dropdown-toggle arrow-none card-drop"
            data-toggle="dropdown"
            aria-expanded="false"
          >
            <i className="mdi mdi-dots-vertical"></i>
          </a>
          <div className="dropdown-menu dropdown-menu-right">
            <a href="javascript:void(0);" className="dropdown-item">
              Sales Report
            </a>
            <a href="javascript:void(0);" className="dropdown-item">
              Export Report
            </a>
            <a href="javascript:void(0);" className="dropdown-item">
              Profit
            </a>
            <a href="javascript:void(0);" className="dropdown-item">
              Action
            </a>
          </div>
        </div>

        <h4 className="header-title mb-0">Total Revenue</h4>

        <div className="widget-chart text-center" dir="ltr">
          <div
            ref={worldMapMarkersRef}
            id="world-map-markers"
            style={{ height: "230px" }}
            className="mt-4"
          ></div>

          <h5 className="text-muted mt-4">Total sales made today</h5>
          <h2>$178</h2>

          <p className="text-muted w-75 mx-auto sp-line-2">
            Traditional heading elements are designed to work best in the meat
            of your page content.
          </p>

          <div className="row mt-4">
            <div className="col-4">
              <p className="text-muted font-15 mb-1 text-truncate">Target</p>
              <h4>
                <i className="fe-arrow-down text-danger mr-1"></i>$7.8k
              </h4>
            </div>
            <div className="col-4">
              <p className="text-muted font-15 mb-1 text-truncate">Last week</p>
              <h4>
                <i className="fe-arrow-up text-success mr-1"></i>$1.4k
              </h4>
            </div>
            <div className="col-4">
              <p className="text-muted font-15 mb-1 text-truncate">
                Last Month
              </p>
              <h4>
                <i className="fe-arrow-down text-danger mr-1"></i>$15k
              </h4>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default TotalRevenueChart;
